import React from 'react';
import HomePage from "./pages/homepage/HomePage";
import './App.css'

import {
  Switch,
  Route,
  Link
} from "react-router-dom";
import MenuItem from './components/menu-item/MenuItem';

const App = () => {
  return (


    <div className="App">

      <HomePage />

      <Link to="/about">Dashboard</Link>

      <Switch>
        <Route exact path="/">
          <HomePage />
        </Route>
        <Route path="/about">
          <MenuItem />
        </Route>
      </Switch>

    </div>


  );
};

export default App;
